import react from "react"

const navlinks = [
    {
        name: "Home",
        link: "/home",
    },
    {
        name: "About",
        link: "/about"
    },
    {
        name:"Menu",
        link:"/menu"
    },
    {
        name:"Reservations",
        link:"/reservations"
    },
    {
        name:"order",
        link:"/order"
    },

    {
        name: "Login",
        link: "/login"
    }

];

const image =[
    {
        source: "./Assets/images/Logo.png",
        name:  "Log"
    }
]

const Nav = () =>{
return (
    <nav>
        < img src= "./Assets/images/Logo.png" 
        alt = "Logo" width="500" height="600"></img>
        <ul>

            <a href= {navlinks.link} />
            <li name= {navlinks.name}>{navlinks.name}</li>


        </ul>
    </nav>
);

};
export default Nav;
